<?php

use PHPUnit\Framework\TestCase;

require_once __DIR__ . '/../models/Product.php';

class ProductModelTest extends TestCase {

    private $productModel;

    #[\Override]
    protected function setUp(): void {
        $this->productModel = new Product();
    }

    public function testAddProduct(): void {
        $_POST['name'] = "Electric Shaver For Men Shaver Shaver Hair WaterProf";
        $_POST['description'] = "Electric Shaver For Men Shaver Shaver Hair WaterProf.";
        $_POST['price'] = "15000";
        $_POST['amount'] = "5";
        $_POST['sku'] = "RRDES";
        // 'state_id' => '1',
        $_POST['brand'] = "Unbranded";
        $_POST['images[]'] = "data:image/png;base64,";
        $result= $this->productModel->saveProduct()['message'];
        $this->assertEquals($result,"Product created successfully");
    }
    
    public function testGetProducts():void {
       $data = $this->productModel->getAllProducts();
       $this->assertGreaterThan(1, count($data), "El array no tiene más de un elemento."); 
    }
}
